function Home() {
    return (
        <div className="homepage">
            <Introduce></Introduce>
            <Solution></Solution>
            <Description></Description>
            <Techstack></Techstack>
        </div>
    );

}


function Introduce() {
    return (
        <div className="home_introduce">
            <Script title="KNOT" scripts="KNOT Introduce script"></Script>
            <Image source=""></Image>
        </div>
    );
}

function Solution() {
    return (
        <div className="home_solution">
            <Image source=""></Image>
            <Script title="Solution" scripts="KNOT Solution script"></Script>
        </div>
    );
}

function Description() {
    return (
        <div className="home_description">
            <Script title="Description" scripts="KNOT Description script"></Script>
            <Image source=""></Image>
        </div>
    );
}

function Techstack() {
    return (
        <div className="home_techstack">

        </div>
    );
}


function Script(props) {
    return (
        <div className="home_script">
            <h1>{props.title}</h1>
            <p>{props.scripts}</p>
        </div>

    );

}

function Image(props) {
    return (
        <div className="home_image">
            <img src={props.source}></img>
        </div>
    );
}

function Button() {
    return (
        <div className="home_button">
            <input type="button"></input>
        </div>
    );
}

export default Home;
